import React from "react";
import { Link } from "react-router-dom";

const PageCard = (props) => {
  return (
    <div className="pagecard">
      <Link className="pagecard-title" to={props.dest}>
        {props.title}
      </Link>
      <p>{props.disc}</p>
    </div>
  );
};

export default PageCard;
